INSERT INTO `items` VALUES (1,100,160,1,'Sony Headphones offer superior sound quality with noise-cancellation features. Ideal for music lovers and professionals who require high-fidelity audio. The comfortable ear cushions and adjustable headband provide a perfect fit for extended use. These headphones also feature a built-in microphone for clear voice calls and easy control buttons for volume and playback. The sleek design and durable build make them a stylish and long-lasting accessory. Whether you are traveling, working, or relaxing at home, Sony Headphones deliver an immersive audio experience. The long battery life ensures you can enjoy your music without interruptions. Connect seamlessly with Bluetooth and enjoy the freedom of wireless listening. Sony Headphones are compatible with a variety of devices, including smartphones, tablets, and computers. Experience the best in sound quality with Sony Headphones.','Sony Headphones','2024-07-29 14:00:00'),(2,80,130,2,'Apple AirPods Pro 2 offer a revolutionary listening experience with Active Noise Cancellation and Transparency mode. The custom high-excursion Apple driver delivers powerful bass and crisp high frequencies. These AirPods are designed with a more customizable fit, featuring three sizes of soft, silicone tips for a more secure seal. The H1 chip ensures seamless connectivity and a stable wireless connection. With the force sensor, you can easily control music and calls. The Adaptive EQ automatically tunes music to the shape of your ear for a rich, consistent listening experience. The sweat and water resistance make them perfect for workouts and outdoor activities. The wireless charging case provides more than 24 hours of battery life. Experience the future of wireless audio with Apple AirPods Pro 2.','Apple AirPods Pro 2','2024-07-30 08:00:00'),(3,10,20,3,'The Mi Powerbank is a high-capacity portable charger designed to keep your devices powered on the go. With a sleek and compact design, it is easy to carry in your bag or pocket. The large battery capacity ensures that you can charge your smartphone, tablet, or other devices multiple times. The dual USB output ports allow you to charge two devices simultaneously. The high-speed charging technology ensures that your devices are charged quickly and efficiently. The Mi Powerbank features advanced safety features, including overcharge protection, short-circuit protection, and temperature control. The LED indicator shows the remaining battery capacity, so you always know how much power is left. Whether you are traveling, working, or simply out for the day, the Mi Powerbank is the perfect companion to keep your devices charged and ready to use.','Mi Powerbank','2024-07-30 02:00:00'),(4,40,75,1,'The Marshall Speaker is a powerful and stylish audio device that delivers high-quality sound. With its classic design and modern technology, it is perfect for music enthusiasts who appreciate both aesthetics and performance. The speaker features multiple connectivity options, including Bluetooth, AUX, and RCA, allowing you to connect a variety of devices. The custom-tuned drivers and built-in amplifiers provide clear and balanced audio with deep bass and crisp highs. The durable build and premium materials ensure that the speaker will last for years. The intuitive control knobs allow you to adjust the volume, bass, and treble to your liking. The Marshall Speaker is also equipped with a built-in microphone for hands-free calls. Whether you are at home, in the office, or hosting a party, the Marshall Speaker is the perfect addition to your audio setup.','Marshall Speaker','2024-07-29 18:30:00'),(5,60,80,2,'The Security Camera offers advanced surveillance features to keep your home or office safe. With high-definition video quality and night vision, you can monitor your property 24/7. The motion detection feature sends instant alerts to your smartphone whenever movement is detected. The two-way audio allows you to communicate with visitors or intruders through the camera. The wide-angle lens provides a comprehensive view of the area being monitored. The Security Camera is easy to install and can be mounted on walls or ceilings. The weatherproof design makes it suitable for both indoor and outdoor use. The camera supports cloud storage and local storage on an SD card, ensuring that your footage is always safe and accessible. With the Security Camera, you can have peace of mind knowing that your property is under constant surveillance.','Security Camera','2024-07-30 05:00:00'),(6,100,150,3,'The Samsung Galaxy S23 is a cutting-edge smartphone that offers a seamless user experience. With a stunning display and powerful processor, it handles multitasking and high-performance tasks with ease. The advanced camera system captures stunning photos and videos in any lighting condition. The long-lasting battery ensures that you stay connected throughout the day. The Galaxy S23 features a sleek design with a durable build, making it both stylish and robust. The enhanced security features, including facial recognition and fingerprint scanning, keep your data safe. The smartphone supports fast charging and wireless charging, providing convenience and flexibility. The Galaxy S23 runs on the latest Android operating system, offering a smooth and intuitive interface. With its extensive features and high performance, the Samsung Galaxy S23 is the ultimate smartphone for modern users.','Samsung Galaxy S23','2024-07-29 20:45:00'),(7,20,48,1,'The Galaxy Ring is a unique and stylish accessory that combines fashion and technology. It features a sleek design with customizable settings to suit your preferences. The ring tracks your fitness and health metrics, including steps, calories burned, and heart rate. The built-in sensors provide accurate and real-time data to help you stay on top of your health goals. The Galaxy Ring is water-resistant, making it suitable for all types of activities. The long-lasting battery ensures that the ring is always ready to use. The companion app allows you to sync and analyze your data, providing insights into your daily activities and overall health. The Galaxy Ring also offers notification alerts for calls, messages, and other important updates. With its blend of style and functionality, the Galaxy Ring is the perfect accessory for the modern, health-conscious individual.','Galaxy Ring','2024-07-29 22:15:00');
